import * as React from 'react';
import * as styles from '../css/main.scss';
import { Container, IContainer } from './Container';
import { AwsHelper } from '../helpers';

interface IImage extends IContainer {
  badge?: boolean;
  fullWidth?: boolean;
  src?: string;
  alt?: any;
  variant?: 'logo' | 'logo alt';
}

interface IState {
  showAlt: boolean;
  processedSrc?: string;
}

export class Image extends React.Component<IImage, IState> {
  constructor(props: IImage) {
    super(props);

    this.state = { showAlt: false };
    this.onError = this.onError.bind(this);
  }

  public componentDidMount() {
    this.processSrcAndSetState(this.props.src);
  }

  public componentDidUpdate(prevProps: IImage) {
    if (prevProps.src !== this.props.src) {
      this.processSrcAndSetState(this.props.src);
    }
  }

  public render() {
    const classes: string[] = [styles.imageResponsive];
    let filteredProps = {
      ...this.props,
      ...{ height: undefined },
      ...{ width: undefined }
    };
    let src = this.state.processedSrc;

    if (this.props.variant) {
      switch (this.props.variant) {
        case 'logo':
          src =
            'data:image/png;base64,';
          break;
        case 'logo alt':
          src =
            'data:image/png;base64,';
          break;
      }
    }
    return (
      <>
        {this.state.showAlt && (
          <Container className={styles.image} {...this.props}>
            {this.props.alt}
          </Container>
        )}
        {!this.state.showAlt && !this.props.badge && (
          <Container className={styles.image} {...filteredProps}>
            <img
              width={this.props.width}
              height={this.props.height}
              onError={this.onError}
              className={classes.join(' ')}
              src={src}
            />
          </Container>
        )}
        {!this.state.showAlt && this.props.badge && (
          <Container
            className={styles.image}
            {...this.props}
            backgroundImage={'url("' + src + '")'}
            backgroundPosition={'center'}
            backgroundSize={'cover'}
          />
        )}
      </>
    );
  }

  public onError() {
    if (this.props.alt) {
      this.setState({ showAlt: true });
    }
  }

  private processSrcAndSetState(input?: string) {
    if (input) {
      AwsHelper.processSrcFromAWS(input).then((processedSrc: any) => {
        if (processedSrc) {
          this.setState({ processedSrc });
        } else {
          this.setState({ processedSrc: input });
        }
      });
    }
  }
}
